import React, { useEffect, useState } from 'react';
import Alert from '@/components/ui/Alert'; // Asegúrate de que la ruta sea correcta

const Home = () => {
    const [personas, setPersonas] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        loadPersonas();
        document.body.style.background = 'linear-gradient(to right, #f7c1c2, #ffb199)';
        document.body.style.minHeight = '100vh';

        return () => {
            document.body.style.background = '';
            document.body.style.minHeight = '';
        };
    }, []);

    const loadPersonas = async () => {
        try {
            const token = localStorage.getItem('token');
            const response = await fetch('http://localhost:9001/Laboratorio1/personas', {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });
            const data = await response.json();
            setPersonas(data);
        } catch (error) {
            console.error("Error loading personas:", error);
            setError("Error al cargar las personas.");
        }
    };

    const handleDelete = async (id) => {
        if (window.confirm('¿Estás seguro? ¡No podrás recuperar este registro!')) {
            try {
                const token = localStorage.getItem('token');
                const response = await fetch(`http://localhost:9001/Laboratorio1/personas/${id}`, {
                    method: 'DELETE',
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });

                if (response.ok) {
                    console.log("Persona eliminada con éxito.");
                    loadPersonas();
                    alert('El registro ha sido eliminado.');
                } else {
                    console.error("Error al eliminar la persona.");
                    alert('No se pudo eliminar el registro.');
                }
            } catch (error) {
                console.error("Error en la solicitud:", error);
                alert('No se pudo eliminar el registro.');
            }
        } else {
            console.log("Eliminación cancelada.");
        }
    };

    const handleLogout = () => {
        if (window.confirm('¿Estás seguro que deseas cerrar sesión?')) {
            localStorage.removeItem('token');
            window.location.href = '/login';
        }
    };

    const buttonStyle = {
        padding: '10px 15px',
        margin: '5px',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
        transition: 'background-color 0.3s',
    };

    return (
        <div className="p-5">
            <h1 className="text-2xl font-bold mb-4">Bienvenido a la aplicación</h1>
            <button 
                className="btn btn-danger"
                onClick={handleLogout}
            >
                Cerrar Sesión
            </button>
            {error && <Alert variant="danger">{error}</Alert>}
            <table className="table table-bordered mt-4">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Primer Nombre</th>
                        <th>Segundo Nombre</th>
                        <th>Primer Apellido</th>
                        <th>Segundo Apellido</th>
                        <th>Edad</th>
                        <th>Identificación</th>
                        <th>Email</th>
                        <th>Fecha de Nacimiento</th>
                        <th>Edad Clínica</th>
                        <th>Ubicación</th>
                        <th>Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {personas.length > 0 ? (
                        personas.map((persona) => (
                            <tr key={persona.id}>
                                <td>{persona.id}</td>
                                <td>{persona.primerNombre}</td>
                                <td>{persona.segundoNombre}</td>
                                <td>{persona.primerApellido}</td>
                                <td>{persona.segundoApellido}</td>
                                <td>{persona.edad}</td>
                                <td>{persona.identificacion}</td>
                                <td>{persona.email}</td>
                                <td>{persona.fechaNacimiento}</td>
                                <td>{persona.edadClinica}</td>
                                <td>
                                    {persona.ubicacion ? `${persona.ubicacion.lugar}, ${persona.ubicacion.ciudad}, ${persona.ubicacion.departamento}` : 'No disponible'}
                                </td>
                                <td>
                                    <button 
                                        className="btn btn-primary"
                                        style={buttonStyle}
                                        onClick={() => window.location.href = `/update/${persona.id}`}
                                    >
                                        Actualizar
                                    </button>
                                    <button 
                                        className="btn btn-danger"
                                        style={buttonStyle}
                                        onClick={() => handleDelete(persona.id)}
                                    >
                                        Eliminar
                                    </button>
                                </td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="12" className="text-center">No hay personas disponibles.</td>
                        </tr>
                    )}
                </tbody>
            </table>
            <button 
                className="btn btn-secondary"
                style={buttonStyle}
                onClick={() => window.location.href = '/map'}
            >
                Ver Ubicaciones en Mapa
            </button>
        </div>
    );
};

export default Home;
